01/Jul/25 9:47 AM;Ashley_cleavenger@swifttrans.com;Sample Query: 

select b.JODATE, b.JOTIME, b.JOUSER, SOORD, SOSTP#, SOLSTA, SOCUST, SOCTYC, SOST, SOARDT, SOARTM, SOLUDT, SOLUTM FROM (Select a.*, row_number() over(partition by a.soord, a.SOSTP#, a.SOLSTA order by a.jodate DESC, a.jotime DESC) as row_nbr from ( Select * from IESR7FL48.DSPSTPLOG where SOLSTA in ('A', 'D') ) as a) as b INNER JOIN (select DIODR# from iesr7file.load load left join iesr7file.cadatep disp_dt on load.DIDATE = disp_dt.caljul where DIDFMG = 'SYR8' and disp_dt.caisoe between '2024-12-01' and '2025-06-30' GROUP BY DIODR#) load on b.SOORD = load.DIODR# LEFT JOIN IESR7FILE.cadatep WHERE b.row_nbr = 1 and JOUSER <> 'MCSBS' ORDER BY SOORD, SOSTP#

 ;;;

